import React, { useContext, useEffect } from 'react'

import { UrlsContext } from '../../contexts/UrlsContext'

import LinkListItem from './LinkListItem'
import { LinkListWrapper, ListWrapper } from './styles'

const LinksList = () => {
  const { links, linksDispatch } = useContext(UrlsContext)

  return (
    <LinkListWrapper>
      <ListWrapper>
        {links.length !== 0 ? (
          links.map(link => <LinkListItem link={link} key={link.hashid} />)
        ) : (
          <p>No urls here!</p>
        )}
      </ListWrapper>
    </LinkListWrapper>
  )
}

export default LinksList
